import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';

const ChangelogContainer = styled(motion.div)`
  margin-bottom: 60px;
`;

const ChangelogHeader = styled(motion.div)`
  text-align: center;
  margin-bottom: 50px;
  
  .header-icon {
    font-size: 4em;
    color: #ff4081;
    margin-bottom: 20px;
    text-shadow: 0 0 30px rgba(255, 64, 129, 0.6);
    animation: pulse 3s ease-in-out infinite;
  }
  
  h2 {
    font-family: 'Press Start 2P', cursive;
    font-size: clamp(2em, 6vw, 3.5em);
    color: #ff4081;
    text-transform: uppercase;
    text-shadow: 0 0 20px rgba(255, 64, 129, 0.5);
    margin-bottom: 20px;
    background: linear-gradient(45deg, #ff4081, #e03570, #ff4081);
    background-size: 200% 200%;
    -webkit-background-clip: text;
    -webkit-text-fill-color: transparent;
    animation: gradientShift 3s ease infinite;
  }
  
  p {
    font-size: clamp(1.1em, 2.5vw, 1.4em);
    color: #b0b0c0;
    font-weight: 500;
    max-width: 600px;
    margin: 0 auto;
    line-height: 1.6;
  }
  
  @keyframes gradientShift {
    0%, 100% { background-position: 0% 50%; }
    50% { background-position: 100% 50%; }
  }
  
  @keyframes pulse {
    0%, 100% { transform: scale(1); }
    50% { transform: scale(1.05); }
  }
`;

const ChangelogGrid = styled(motion.div)`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(400px, 1fr));
  gap: 30px;
  
  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const ChangelogCard = styled(motion.div)`
  background: linear-gradient(135deg, rgba(25, 25, 40, 0.95), rgba(35, 35, 55, 0.95));
  border: 1px solid rgba(255, 64, 129, 0.2);
  border-radius: 20px;
  padding: 30px;
  transition: all 0.4s ease;
  cursor: pointer;
  backdrop-filter: blur(15px);
  position: relative;
  overflow: hidden;
  
  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: -100%;
    width: 100%;
    height: 100%;
    background: linear-gradient(90deg, transparent, rgba(255, 64, 129, 0.1), transparent);
    transition: left 0.6s ease;
  }
  
  &:hover::before {
    left: 100%;
  }
  
  &:hover {
    transform: translateY(-8px);
    border-color: rgba(255, 64, 129, 0.5);
    box-shadow: 0 15px 40px rgba(255, 64, 129, 0.2);
  }
  
  .patch-badge {
    display: inline-block;
    background: linear-gradient(135deg, #ff4081, #e03570);
    color: white;
    padding: 8px 16px;
    border-radius: 20px;
    font-family: 'Roboto', sans-serif;
    font-size: 0.8em;
    font-weight: 600;
    text-transform: uppercase;
    letter-spacing: 1px;
    margin-bottom: 20px;
    box-shadow: 0 0 15px rgba(255, 64, 129, 0.4);
  }
  
  .patch-title {
    font-family: 'Press Start 2P', cursive;
    font-size: 1.2em;
    color: #ff4081;
    margin-bottom: 15px;
    text-transform: uppercase;
    line-height: 1.3;
  }
  
  .patch-date {
    display: flex;
    align-items: center;
    gap: 8px;
    font-family: 'Roboto', sans-serif;
    font-size: 0.9em;
    color: #b0b0c0;
    margin-bottom: 20px;
    
    i {
      color: #ff4081;
    }
  }
  
  .patch-highlights {
    margin-bottom: 25px;
    
    .highlight-item {
      display: flex;
      align-items: flex-start;
      gap: 10px;
      margin-bottom: 12px;
      font-family: 'Roboto', sans-serif;
      font-size: 0.95em;
      color: #e0e0e0;
      line-height: 1.5;
      
      i {
        color: #ff4081;
        font-size: 0.8em;
        margin-top: 6px;
        min-width: 12px;
      }
    }
  }
  
  .read-more-btn {
    display: inline-flex;
    align-items: center;
    gap: 8px;
    background: rgba(255, 64, 129, 0.2);
    border: 1px solid rgba(255, 64, 129, 0.4);
    border-radius: 25px;
    padding: 10px 20px;
    color: #ff4081;
    font-family: 'Roboto', sans-serif;
    font-size: 0.9em;
    font-weight: 600;
    text-decoration: none;
    transition: all 0.3s ease;
    
    &:hover {
      background: rgba(255, 64, 129, 0.3);
      transform: scale(1.05);
      box-shadow: 0 0 15px rgba(255, 64, 129, 0.3);
    }
    
    i {
      font-size: 0.9em;
    }
  }
`;

const ChangelogSection = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.2
  });

  const containerVariants = {
    hidden: { opacity: 0, y: 50 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.6,
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: {
      opacity: 1,
      y: 0,
      transition: { duration: 0.5 }
    }
  };

  const changelogs = [
    {
      title: 'Patch 1.3 - "Floor 7 Unleashed"',
      date: 'Feb 27, 2025',
      changes: [
        'Introduced Floor 7 with "Nether Wraith" mobs.',
        'Added "Blaze Strike" enchantment.',
        'Fixed various bugs and improved performance.'
      ]
    },
    {
      title: 'Patch 1.2 - "Guild Wars"',
      date: 'Feb 20, 2025',
      changes: [
        'Guild overhaul with shared vaults.',
        'Outposts added for rare drops.',
        'New guild ranking system implemented.'
      ]
    },
    {
      title: 'Patch 1.1 - "Energy Boost"',
      date: 'Feb 13, 2025',
      changes: [
        'Energy system rework for better balance.',
        'New enchantments and weapon types.',
        'Quality of life improvements.'
      ]
    }
  ];

  return (
    <ChangelogContainer
      ref={ref}
      variants={containerVariants}
      initial="hidden"
      animate={inView ? "visible" : "hidden"}
    >
      <ChangelogTitle variants={itemVariants}>
        <h1>Recent Changelogs</h1>
      </ChangelogTitle>
      
      <ChangelogHeader variants={itemVariants}>
        <h2>Latest Updates</h2>
      </ChangelogHeader>
      
      <ChangelogList>
        {changelogs.map((changelog, index) => (
          <ChangelogEntry
            key={index}
            variants={itemVariants}
            as={Link}
            to={`/updates/${index + 1}`}
            whileHover={{ 
              x: 5,
              transition: { duration: 0.2 }
            }}
          >
            <h3>{changelog.title}</h3>
            <p><strong>Date:</strong> {changelog.date}</p>
            {changelog.changes.map((change, changeIndex) => (
              <p key={changeIndex}>- {change}</p>
            ))}
            <span className="read-more">Read More</span>
          </ChangelogEntry>
        ))}
      </ChangelogList>
    </ChangelogContainer>
  );
};

export default ChangelogSection;
